'Schepenboekje 1815-1894' met gegevens over het transport van troepen naar Oost-Indië:
- Alfabetische lijst van scheepsnamen met vermelding van de namen van de officieren, 1817-1825;
- Lijst van scheepsnamen met vermelding van de legeronderdelen of het aantal officieren per transport, 1815-1869, met namenklapper;
- Overzicht van de scheeptransporten met vermelding van aantallen officieren, onderofficieren en minderen bij de inscheping in Nederland en bij aankomst in Oost-Indië, 1848-1894.
